I have a GPI ar15 lower receiver for sale (just lower receiver). I have built a few ar's with these and they are top notch quality. The finish is bare aluminum (already sandblasted) and can be cerakoted in the color of your choice I will do the color at no additional charge (depending on the single color you choose).  All standard milspec parts will work in this with out any fitting required. This is just the lower receiver for sale no other parts are included. If you would like I also have an LPK and standard capacity 30 rounds magazines for an additional charge along with discounted cerakote application. Price does not include sale tax. Additional discount on ar 15 parts, ammo, and free help if needed to assemble. 
  I am an FFL dealer and all paper work and background checks do apply. Must be 21yrs old to purchase this. I have all the parts needed (except the receiver extenxsion
) to complete a 16.5' barreled carbine.
